import React from 'react';
import { Container, Jumbotron, Row } from 'react-bootstrap';
import './MainJumbotron.css';



export const MainJumbotron = () => (
    <Jumbotron fluid>
        <Row>
            <Container class="col-4 d-flex">nice pic here</Container>
            <Container class="col d-flex">
                <h1 class="text-secondary-light bg-dark col-4">Blue sky ideas on how to reduce single-use items </h1>
            </Container>
        </Row>

    </Jumbotron>
)
